ADOBE ILLUSTRATOR CS5 TRAINING DVD FOR WINDOWS &amp; MAC 

In Illustrator CS5 One-on-One: Advanced, author and industry expert Deke McClelland teaches how to take advantage of the wide array of dynamic features in Illustrator CS5. This course demonstrates how to apply these features to paths, groups, and editable text to create professional-quality artwork. The course covers Live Trace, Live Paint, and Live Colour, as well as symbols, gradients, exporting, and integration with Photoshop. Exercise files accompany the course.

Topics include:

    * Tracing a pixel-based image
    * Sketching and drawing for Illustrator
    * Creating and editing gradients
    * Creating multi-coloured blends
    * Creating seamlessly repeating tile patterns
    * Creating interlocking artwork with Live Paint
    * Designing advanced type effects
    * Recoloring artwork with colour harmonies
    * Making the most of symbols
    * Integrating Illustrator with Photoshop
    * Using transparency, blend modes, and opacity masks

